/* Hold options for tag-field */
export class TagDataTableColumn {
    render() {
        return null;
    }
    static get is() { return "tag-table-column"; }
    static get encapsulation() { return "shadow"; }
    static get properties() { return {
        "caption": {
            "type": String,
            "attr": "caption"
        },
        "cellAccentField": {
            "type": String,
            "attr": "cell-accent-field"
        },
        "cellFieldStyle": {
            "type": String,
            "attr": "cell-field-style"
        },
        "cellHeight": {
            "type": String,
            "attr": "cell-height"
        },
        "cellWidth": {
            "type": String,
            "attr": "cell-width"
        },
        "dataType": {
            "type": String,
            "attr": "data-type"
        },
        "formattingOptions": {
            "type": String,
            "attr": "formatting-options"
        },
        "name": {
            "type": String,
            "attr": "name"
        },
        "sortable": {
            "type": String,
            "attr": "sortable"
        }
    }; }
    static get style() { return "/**style-placeholder:tag-table-column:**/"; }
}
